import React, { Component } from "react";
import {connect, Provider} from "react-redux";
import {BrowserRouter as Router, Route, withRouter} from "react-router-dom";
import { createBrowserHistory } from 'history';

import Navi from "./Navi";
import Body from "./body";
import Login from "./login";
import Register from "./register";
import Home from "./home";
import Debit from "./debit";
import Credit from "./credit";
import Wallets from "./Wallets";
import Status from "./status";
import Statement from "./statement";
import Default from "./default";
import Footer from "./footer";


// const mapStateToProps=state=>{
//     return
//     {
//         name     : state.name;
//         password : state.password;
//     }
// }

class Main extends Component
{
    render() {
        return(

                <div className="App">

                    <Router history={history}>
                        <Navi/>
                        <Route exact path='/' render={()=><Body/>}/>
                        <Route exact path='/log' render={()=><Login/>}/>
                        <Route exact path='/register' render={()=><Register/>}/>
                        <Route exact path='/home' render={()=><Home/>}/>
                        <Route exact path='/debit' render={()=><Debit/>}/>
                        <Route exact path='/credit' render={()=><Credit/>}/>
                        <Route exact path='/wallets' render={()=><Wallets/>}/>
                        <Route exact path='/status' render={()=><Status/>}/>
                        <Route exact path='/statement' render={()=><Statement/>}/>
                        <Route exact path='/default' render={()=><Default/>}/>
                        <Footer/>
                    </Router>
                </div>
        )
    }

}
export default Main;
